import {toJS} from 'mobx';
export class FavCharacterStore{

    @observable favChars = []

    @action addToFavList (character, url) {
        
        character.push.apply(character,url)
        //this.favChars.push(character);
        console.log("new array",toJS (this.favChars));
    }
};
